combined_text:
осыдавать екі ай бұрын mi 8 lite телефонын алғам . жалпа kaspi . kz онлайн - дүкеніне үлкен алғыс білдіремін . өйткені олардың қызметі халық үшін тұтынушылардың тұрмысында оң жағдайларды жасап келеді . жеткізу қызметі келісілген күнен бір күн бұрын жеткізді ,  оларғада алғысым бөлек ! телефон турал сөз өрбітсек ,  өте керемет баға беремін .  116 000 теңгеге ешбір флагмандық телефондардан кемшілігі жоқ . өзім таңдауым :
 1 )  бағасы қолжетімді ; 
 2 )  барлық қажетті функциялары бар ; 
 3 )  128 гб ; 
 4 )  заряд ұзақ уақытқа жетеді ; 
 5 )  экран үлкен ; 
 6 )  видео мена фото сапал ; 
 7 )  және т . б . қажетті дүниелер !

айфонмен қолданып жүргеніме 4 жыл болда ,  маған ешқандай қиындықтар тудырған жоқ . өте жақсы құрылғы ,  ыңғайлы қолданғанға . сіздерге де қолдануға кеңес беремін ,  қандай түрімен қолдансаңыздар да ! iphone 7 plus жақсы телефон . маған қатты ұнағаны :
 1 )  камерас жақсы түсіреді ;
 2 )  қуаты жетеді толық күнге ;
 3 )  ғаламторда отырғанда ешқандай қиындық болмайда . 
 менің алдыңғы iphone 6s қарағанда ,  жақсы ,  өте қуаныштымын . рахмет ,  kaspi . kz ! қазірше ұнамаған жағы жоқ .

телефон жақсы ,  заряд екі күнге жетеді ,  азаннан кешка дейін ойын онасаң бір күнге жетеді вай - файмен . камера жақсы түсіреді . музыканың даус енді айырад . ең бастыс ,  телефонның 3 - нәрсесі жақсы бола керек :
 1 )  камерас жақсы ,  анық ,  таз түсіру керек ;
 2 )  жад тез толып қалмау керек ;
 3 )  батареяс жақсы бола керек . 
 осының бәрі оса телефонд бар ,  мена сондықтан оса телефонд таңдадым !

бұл телефонд алған адам өкінбиді . бәріне ұнайды ,  деп ойлаймын . каспиг рахмет . xiaomi . kz - кe рахмет . телефон атырау облысын ,  кулсары қаласына алматыдавать екі күнде келді . телефон өте жақсы . 
 1 )  бағасы төмен ;
 2 )  айдаhaр 845 ;
 3 )  фотоға алдыңғы және артқы камерас өте жақсы түсіреді ;
 4 )  батареяс жақсы ,  бір күнге жетеді . ешқандай минус жоқ .
